Não é fraqueza
Não é drama
Não é falta de Deus
Não é loucura
Não é incapacidade
Não é defeito
Não é imutável 
Não é seu destino
Não é você. 
Você não é sua dor! Você não é ansiedade, você não é depressão, não é psicopatia, esquizofrenia ou anorexia... 
Talvez alguma/várias dessas condições em diferentes graus de intensidade te causem limitações e dificuldades que junto as suas capacidades, experiências, intelectualidade, personalidade, genética, divindade, façam parte da sua identidade. Você é complexo, profundo, humanamente incompreensível como um todo. Você é mais do que palavras no vocabulário possam descrever, você é mais do que você mesmo consegue assimilar. Você é a obra mais importante do Criador do universo! A natureza, o céu, a terra, a experiência mortal foram criados para você. Você é filho/a de Deus. FILHO! Você tem acesso a fonte de vida, paz e luz. Por favor, se apegue a mão que está estendida pra você. Se atente aos anjos em forma de gente que cruzam seu caminho. Use e abuse da ciência, medicina, terapias, exercícios físicos, tecnologias disponíveis para aliviar seu fardo. Seu cérebro tem a capacidade de fazer novas conexões neurais, depois de muito trabalho e repetição é possível reestruturar até a forma com os químicos são liberados no seu organismo. Há esperança...
