•
When I first moved back to the states from overseas, I was anxious moving to a new state and didn’t really know what to expect. I had a huge church family at my last assignment and I knew having this community was really what kept me grounded in so many ways!
•
Coming from the bodybuilding world, I had all of the doubts about trying out CrossFit and even said “you’ll never catch me doing CrossFit because I’ll probably break something even trying!”
•
Fast forward a year and a half and I love it! Not just for the sport, but for the family and community I’ve gained from my CrossFit gym at @helotes_crossfit !
•
We push each other through every workout, we motivate each other to hit our goals, and we cheer each other on when we achieve new lifts!
•
This is a HUGE shoutout to my HCF Family & all of the love you all have poured into me! 💙
•
P.S. If you’re lucky, you’ll get some pretty awesome pictures of your lifts, too! 👏🏼
